import React from 'react'

import s from './Prisoner.module.css'

type Props = {
    img: any
    time: number
    name: string
    university: string
    course: number
    text: string
}

const Prisoner: React.FC<Props> = ({img, time, name, university, course, text}) => {
    return (
      <div className={s.container}>
        <img src={img} alt="photo" />
        <div className={s.sentence}>до {time} лет тюрьмы</div>
      </div>
    );
}

export default Prisoner
